parameters.script:
"// RPG Maker MZ 이벤트 스크립트
// 맵 이동 전후 페이드 효과와 함께 스위치 설정 및 맵 이동

// 1. 맵 이동 전 화면을 어둡게 (페이드 아웃)
$gameScreen.startFadeOut(60); // 60프레임 동안 페이드 아웃

// 2. 페이드 아웃이 완료될 때까지 대기
while ($gameScreen._brightness < 0) {
    // 페이드 아웃이 완료될 때까지 대기
}

// 3. 특정 스위치를 ON으로 설정
$gameSwitches.setValue(14, true);

// 4. 맵 14번으로 이동 (reserveTransfer 사용)
$gamePlayer.reserveTransfer(15, 18, 39, 8, 0); // 맵 ID, X, Y, 방향, 페이드 타입

// 5. 맵 이동 후 화면을 밝게 (페이드 인)
$gameScreen.startFadeIn(60); // 60프레임 동안 페이드 인 "
